import React from 'react'

function List({ list }) {
    return (
        <div className='container'>
            <div className='col-md-8 offset-2 mt-5'></div>
            {list.map((item) => {
                <div class="card">
                    <div class="card-body">
                        {/* This is some text within a card body. */}
                        {list[0].text}
                    </div>
                </div>
            })}

        </div>
    )
}

export default List
